import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Login from "./Login";
import DashBoard from "./DashBoard";
import Signup from "./Signup";
import "./App.css";
import OwnerLogin from "./OwnerLogin";
import OwnerSignup from "./OwnerSignup";
import OwnerDashboard from "./OwnerDashboard";
function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/dashboard/*" element={<DashBoard />} />
          <Route path="/ownerlogin" element={<OwnerLogin />} />
          <Route path="/ownersignup" element={<OwnerSignup />} />
          <Route path="/owner-dashboard" element={<OwnerDashboard />} />
        </Routes>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <div>
      <div className="hero-section">
        <div className="overlay">
          <h1 className="logo">Wander more Worry less</h1>
          <h2 className="tagline">Discover the best places</h2>
          <div className="menu-links">
            <Link to="/login" className="login-button">Log in</Link>
            <Link to="/signup" className="signup-button">Sign up</Link>
            <Link to="/ownerlogin" className="owner-button">Owner</Link>
          </div>
        </div>
      </div>
      <div className="card-section">
        <div className="card">
          <img src="https://img.freepik.com/premium-vector/food-delivery-service-fast-food-delivery-scooter-delivery-service_67394-1141.jpg" alt="Order Online" />
          <h3>Buses</h3>
          <p>Stay home and order to your doorstep</p>
        </div>
        <div className="card">
          <img src="https://static.vecteezy.com/system/resources/previews/036/804/331/non_2x/ai-generated-assorted-indian-food-on-dark-wooden-background-free-photo.jpg" alt="Dining" />
          <h3>Dining</h3>
          <p>View the city's favourite dining venues</p>
        </div>
        <div className="card">
          <img src="https://5.imimg.com/data5/ANDROID/Default/2022/5/HY/LJ/QP/108564154/product-jpeg-500x500.jpg" alt="Live Events" />
          <h3>Live Events</h3>
          <p>Discover Indiaâ€™s best events & concerts</p>
        </div>
      </div>
    </div>
  );
}


export default App;
